import React, { useEffect, useRef } from "react";
import ITyped from "react-ityped";

const About = () => {
    const strings = [
        "react-ityped",
        "is a",
        "react component",
        "that wraps npm ityped package.",
    ];

    return (
        <div className="relative text-center">
            <h2>Hi I'm </h2>
            <h1>Nwaose Victor</h1>
            <h3>Freelance {""}</h3>
            <ITyped
                className="container ityped-cursor"
                showCursor={false}
                strings={strings}
                typeSpeed={500}
                backSpeed={500}
                startDelay={500}
                backDelay={500}
            />
        </div>
    );
};

export default About;
